import './App.css';
import { Navbar } from 'react-bootstrap';
import { Container } from 'react-bootstrap';

function App() {
  return (
    <Navbar bg="dark">
    <Container>
      <Navbar.Brand href="#home">
        <img
          src="/logo.svg"
          width="30"
          height="30"
          className="d-inline-block align-top"
          alt="React Bootstrap logo"
        />
      </Navbar.Brand>
    </Container>
  </Navbar>
  );
}

export default App;
